import React from 'react';
import Layout from '../components/common/Layout';

const Home = () => {
    return (
        <Layout>
            <div className="flex flex-col items-center justify-center h-screen">
                <h1 className="text-4xl font-bold mb-4">Welcome to Our Application</h1>
                <p className="text-lg mb-8">This is the landing page where you can find the latest updates and features.</p>
                <button className="bg-blue-500 text-white px-4 py-2 rounded">Get Started</button>
            </div>
        </Layout>
    );
};

export default Home;
